★ウインカーポジション機能付　8ピンICリレーです。<br>
★ウインカーバルブのLED化で発生するハイフラ現象の防止機能搭載.
<br>
★一部の車種で採用され始めている、高級感ある電子カチカチ音（ウインカー作動音）ユニット付き<br>
★点滅スピード調整可能<br>
★日本語説明書付き<br>
<br>
●適合車種●<br>
適合車種/トヨタ、ダイハツ、スバル、スズキの純正ウインカーリレーが８ピンタイプ<br>
12V車専用<br>


